 ip ospf cost 1
 description "To Omega"
 speed auto
 duplex auto
!
interface FastEthernet0/1
 ip address 10.0.0.34 255.255.255.254
 ip ospf 100 area 0
 ip ospf cost 1
 description "To Hawkinsville"
 speed auto
 duplex auto
!
router ospf 100
